import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import Homepage from './components/Customer/Homepage';
import Orders from './components/Customer/Orders';
import Profile from './components/Customer/Profile';
import Checkout from './components/Customer/Checkout';
import Cart from './components/Customer/Cart';
import Home from './components/Retail/Home';
import ManageOrder from './components/Retail/ManageOrder';
import ManageDiscount from './components/Retail/ManageDiscount';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Router>
      <Routes>
        <Route path ="/Customer/Home" element={<Homepage />}/>
        <Route path ="/Customer/Orders" element={<Orders />}/>
        <Route path ="/Customer/Pofile" element={<Profile />}/>
        <Route path ="/Customer/Checkout" element={<Checkout />}/>
        <Route path ="/Customer/Cart" element={<Home />}/>
        <Route path ="/Retail/Home" element={<Home />}/>
        <Route path ="/Retail/Orders" element={<Home />}/>
        <Route path ="/Customer/Discounts" element={<Home />}/>
      </Routes>
    <App />
    </Router>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
